import React from "react";
import { useNavigate } from "react-router-dom";
//  import { BrowserRouter } from "react-router-dom";
import { irParaPokedex } from "../Routes/Cordination";
import { Header } from "../components/Header";
import styled from "styled-components";
import {  } from "../components/Header";




const CorStyled = styled.div`
  background:#23437D ; 
  flex-wrap: wrap; 
  min-height: 100vh;
  height: max-content; 
  padding-top: 1%; 
  padding-bottom: 10%;
  padding: 0px;
  margin: 0px;

  `
const Button = styled.div `
background: #67C0DC;
display: grid;
grid-template: 1fr / 1fr;
width: 70px;
border: 2px solid blue;
transition: 1s;
cursor: pointer;
float: right;
margin-top:26px;
margin-right:20px;
margin-top: 15px;
`




export const Home = () => {

    const navigate = useNavigate()

    return (
        <div>
            <Header />
            <CorStyled>

            </CorStyled>
            <Button onClick={() => irParaPokedex(navigate)}>Ir Para Pokedex</Button>



        </div>
    )
}
